import React, { useEffect } from "react";
import store from "store";
import Login from './Login';

export default props => {
  useEffect(async () => {
    const token = store.get("token");
    console.log(this.props.location.path);
    if (!token) {
      props.history.push("/login");
    } else {
      
      store.remove("token");
      props.history.push("/login");
    }
  }, []);
  
};
